const int sensorPin = A0;
const float VREF = 1.0;            // Max ADC voltage on NodeMCU
const int samples = 2000;
const float calibration = 10.0;   // Kalibrasi sesuai datasheet 100A = 1V

void setup() 
{
    pinMode(LED_BUILTIN, OUTPUT);

       Serial.begin(9600);
       delay(10);
               
