def takePhoto(name="crop.png"):
    w, h = pyautogui.size()
    img = pyautogui.screenshot().crop((
        int(w * (1882 / 2560)),
        int(h * (50 / 1440)),
        w,
        int(h * (300 / 1440))
    ))
    img.save(name)
    return name


