public class Vector {

    // Ğ¡ĞºĞ°Ğ»ÑÑ€Ğ½Ğ¾Ğµ Ğ¿Ñ€Ğ¾Ğ¸Ğ·Ğ²ĞµĞ´ĞµĞ½Ğ¸Ğµ
    static int dot(int[] a, int[] b) {
        int res = 0;
        for (int i = 0; i < a.length; i++) {
            res += a[i] * b[i];
        }
        return res;
    }

    // Ğ¡Ğ»Ğ¾Ğ¶ĞµĞ½Ğ¸Ğµ Ğ²ĞµĞºÑ‚Ğ¾Ñ€Ğ¾Ğ²
    static int[] add(int[] a, int[] b) {
        int[] res = new int[a.length];
        for (int i = 0; i < a.length; i++) {
            res[i] = a[i] + b[i];
        }
        return res;
    }

    // ĞŸÑ€Ğ¸Ğ¼ĞµÑ€
    public static void main(String[] args) {
        int[] x = {1, 2, 3};
